function CD(t) {
  const e = t.regex, n = /([2-9]|[1-2]\d|[3][0-5])\^\^/, r = /(\w*\.\w+|\w+\.\w*|\w+)/, i = /(\d*\.\d+|\d+\.\d*|\d+)/, o = e.either(e.concat(n, r), i), a = /``[+-]?(\d*\.\d+|\d+\.\d*|\d+)/, s = /`([+-]?(\d*\.\d+|\d+\.\d*|\d+))?/, l = e.either(a, s), c = /\*\^[+-]?\d+/, d = {
    className: "number",
    relevance: 0,
    begin: e.concat(
      o,
      e.optional(l),
      e.optional(c)
    )
  }, p = /[a-zA-Z$][a-zA-Z0-9$]*/, _ = new Set(TD), m = { variants: [
    {
      className: "builtin-symbol",
      begin: p,
      // for performance out of fear of regex.either(...Mathematica.SYSTEM_SYMBOLS)
      "on:begin": (T, C) => {
        _.has(T[0]) || C.ignoreMatch();
      }
    },
    {
      className: "symbol",
      relevance: 0,
      begin: p
    }
  ] }, f = {
    className: "named-character",
    begin: /\\\[[$a-zA-Z][$a-zA-Z0-9]+\]/
  }, h = {
    className: "operator",
    relevance: 0,
    begin: /[+\-*/,;.:@~=><&|_`'^?!%]+/
  }, E = {
    className: "pattern",
    relevance: 0,
    begin: /([a-zA-Z$][a-zA-Z0-9$]*)?_+([a-zA-Z$][a-zA-Z0-9$]*)?/
  }, S = {
    className: "slot",
    relevance: 0,
    begin: /#[a-zA-Z$][a-zA-Z0-9$]*|#+[0-9]?/
  }, b = {
    className: "brace",
    relevance: 0,
    begin: /[[\](){}]/
  }, g = {
    className: "message-name",
    relevance: 0,
    begin: e.concat("::", p)
  };
  return {
    name: "Mathematica",
    aliases: [
      "mma",
      "wl"
    ],
    classNameAliases: {
      brace: "punctuation",
      pattern: "type",
      slot: "type",
      symbol: "variable",
      "named-character": "variable",
      "builtin-symbol": "built_in",
      "message-name": "string"
    },
    contains: [
      t.COMMENT(/\(\*/, /\*\)/, { contains: ["self"] }),
      E,
      S,
      g,
      m,
      f,
      t.QUOTE_STRING_MODE,
      d,
      h,
      b
    ]
  };
}
